css:
.document-outline-section-highlight {
  background-color: #2a9be8;
}
.document-outline-section-highlight .region {
  background-color: #2a9be8;
}
atom-text-editor.editor .document-section .region {
  background-color: #888;
  border-radius: 2px;
  border: 1px solid #888;
  box-sizing: border-box;
  z-index: 0;
}
atom-text-editor.editor .current-section .region {
  border-radius: 2px;
  border: 1px solid white;
  box-sizing: border-box;
  z-index: 0;
}
.document-outline {
  position: relative;
  padding: 4px;
  overflow-y: auto;
  overflow-x: hidden;
  cursor: default;
  user-select: none;
  display: flex;
  flex-direction: column;
  background-color: #2c3e50;
  margin-left: 5px;
  display: block;
}
.document-outline .droptarget {
  border-bottom: 5px;
  border-style: solid;
  border-color: #2a9be8;
}
.document-outline .leaf ol {
  display: none;
}
.document-outline .list-nested-item {
  margin-top: 2px;
  margin-bottom: 4px;
  padding: 1px 4px;
  display: list-item;
}
.document-outline .list-nested-item.highlight {
  color: #ecf0f1;
  background: rgba(255, 255, 255, 0.4);
  background-blend-mode: soft-light;
  border: 1px solid transparent;
  border-radius: 2px;
  padding: 0 3px;
}
.document-outline .list-nested-item span.tree-item-text {
  line-height: normal;
  font-weight: normal;
}
.document-outline .list-nested-item span.tree-item-text.selected {
  background-color: #2a9be8;
  transition: background 0.5s linear;
}
.document-outline .list-nested-item .icon {
  width: 16px;
}
.document-outline .list-nested-item .icon.icon-chevron-down:before {
  margin-right: 0em;
}
.document-outline .list-nested-item .icon.icon-one-dot {
  margin-bottom: -0.7em;
  overflow: hidden;
}
.document-outline .list-nested-item .icon.icon-one-dot:before {
  content: "\25cf";
  font-size: 0.6em;
}
.document-outline .list-nested-item span.tree-item-text:hover {
  text-decoration: underline;
}
.document-outline .list-nested-item .list-tree {
  margin-left: 10px;
}
.document-outline .list-nested-item.level1 span.tree-item-text {
  font-weight: bold;
}
.document-outline .list-nested-item.level2 span.tree-item-text {
  font-weight: normal;
}
.document-outline .list-nested-item.level1 {
  z-index: 100;
}
.document-outline .list-nested-item.level2 {
  z-index: 200;
}
.document-outline .list-nested-item.level3 {
  z-index: 300;
}
.document-outline .list-nested-item.level4 {
  z-index: 400;
}
